    <div className="h-80 px-4 py-2 flex justify-between text-[#F8F4EA] bg-[#579BB1]">
      <h2 className="font-bold">Sparkosol Assessment</h2>
      <nav className="flex gap-2">
        <p>Menu</p>
        <p>Cart</p>
        <p>Orders</p>
        <p>Chat</p>
      </nav>
    </div>
  );
};

export default Navbar;

